import React, {useState} from 'react';
import {useAuth} from './AuthContext';

export default function Signup(){
    const {signup} = useAuth();

    const [accountDetails, setAccountDetails] = useState({alias: "", password : "", password_confirm: "", 
                                                        firstname: "", lastname: "", age: "", height_feet: "", 
                                                        height_inch: "", weight: ""});

    function handleOnChange(e){
        switch(e.target.id){
            case 'alias':
                setAccountDetails({...accountDetails, alias: e.target.value});
                console.log(accountDetails);
                break;
            case 'password':
                setAccountDetails({...accountDetails, password: e.target.value});
                console.log(accountDetails);
                break;
            case 'password_confirm':
                setAccountDetails({...accountDetails, password_confirm: e.target.value})

            default:
                //idk
        }
    }


    function handleOnClick(e){
        e.preventDefault();
        console.log(accountDetails);
    }

    return(
        <>
            <h4> Sign Up! IDIOT</h4>
            <form>
                <input type='text' id='alias' placeholder='Username' onChange={handleOnChange}/> <br/>
                <input type='password' id='password' placeholder='Password' onChange={handleOnChange}/> <br/>
                <input type='password' id='password_confirm' placeholder='Confirm Password'/> <br/>
                <input type='text' id='firstname' placeholder='First Name'/> <br/>
                <input type='text' id='lastname' placeholder='Last Name'/> <br/>
                <input type='text' id='age' placeholder='Age'/> <br/>
                <input type='text' id='height_feet' placeholder='Height (ft)'/> <br/>
                <input type='text' id='height_inch' placeholder='Height (inch)'/> <br/>
                <input type='text' id='weight' placeholder='Weight (lbs)'/> <br/>
                <input type='submit' value='Sign Up' onClick={handleOnClick}/>
            </form>
        </>
    );

}
